import {useState} from 'react';

const Home = () => {
    const [name, setName] = useState('mario');
   
    const handleClick = (newName, e) => {
        setName('luigi')
    }

    return (
        <div className="home">
            <h2>Homepage</h2>
            <p>{name}</p>
            <button onClick={(e) => handleClick("mario",e)}>Click Me</button>
        </div>
      );
}
 
export default Home;
